import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
        {mainHeader()}
        {mainContent()}
    </div>
  );
}

const definitionSearch = <input id={"definition-search-input"} placeholder={"Search"}/>

function mainHeader(){
    return (
        <header className="header">
            <h1>
                Better Definitions
            </h1>
        </header>
    )
}

function mainContent(){
    return (
        <main id={"main-content"}>
            <section id={"d-search"}>
                {definitionSearch}
            </section>
        </main>
    )
}

export default App;
